Creating a program that spies on and records user activity is a complex task and raises significant ethical, legal, and privacy concerns. It's important to note that such a program would be highly intrusive and could be used for malicious purposes.

However, if you're interested in creating a program that logs user activity for legitimate purposes, such as monitoring system usage for troubleshooting or improving user experience, here's a simplified example in Python using the `watchdog` library to monitor file system changes.

```python
from watchdog.observers import Observer
from watchdog.events import FileSystemEventHandler
import time
import os

class Watcher:
    def __init__(self, path):
        self.path = path
        self.observer = Observer()

    def run(self):
        event_handler = Handler()
        self.observer.schedule(event_handler, self.path, recursive=True)
        self.observer.start()
        try:
            while True:
                time.sleep(5)
        except KeyboardInterrupt:
            self.observer.stop()
            print("Observer stopped.")
        self.observer.join()

class Handler(FileSystemEventHandler):
    def on_any_event(self, event):
        if event.is_directory:
            return None

        elif event.event_type == 'created':
            print(f"Created: {event.src_path}")

        elif event.event_type == 'modified':
            print(f"Modified: {event.src_path}")

        elif event.event_type == 'deleted':
            print(f"Deleted: {event.src_path}")

if __name__ == "__main__":
    path = os.getcwd()
    watcher = Watcher(path)
    watcher.run()
```

This script will log any file creation, modification, or deletion events in the current working directory. It's a very basic example and doesn't include any logging or storage of the events. For a more robust solution, you would want to implement logging, error handling, and possibly a database or file for storing the recorded events.

